(42, 'woopay-beta-merchantrecruitment-short-update-09MAY23', 'info', 'en_US', 'Increase conversions with WooPay — our fastest checkout yet', 'Be one of the first to try WooPay, our new express checkout feature. <br>Boost conversions by letting customers pay with a single click. <br><br>Update to the latest version of WooCommerce Payments to get started.', '{}', 'pending', 'woocommerce.com', '2024-04-24 09:12:47', NULL, 0, 'plain', '', 0, 0, 'info'),
(43, 'woocommerce-WCPayments-June-2023-updated-needed', 'update', 'en_US', 'Action required: Security update of WooCommerce Payments', '<strong>Your store requires a security update for the WooCommerce Payments plugin</strong>. Please update the WooCommerce Payments plugin immediately to address a potential vulnerability.', '{}', 'pending', 'woocommerce.com', '2024-04-24 09:12:47', NULL, 0, 'plain', '', 0, 0, 'info'),
(44, 'woocommerce-WCSubscriptions-June-2023-updated-needed', 'marketing', 'en_US', 'Action required: Security update of WooCommerce Subscriptions', '<strong>Your store requires a security update for the WooCommerce Subscriptions plugin</strong>. Please update the WooCommerce Subscriptions plugin immediately to address a potential vulnerability.', '{}', 'pending', 'woocommerce.com', '2024-04-24 09:12:47', NULL, 0, 'plain', '', 0, 0, 'info'),
(45, 'woocommerce-WCReturnsWarranty-June-2023-updated-needed', 'update', 'en_US', 'Action required: Security update of WooCommerce Returns and Warranty Requests extension', '<strong>Your store requires a security update for the Returns and Warranty Requests extension</strong>.  Please update to the latest version of the WooCommerce Returns and Warranty Requests extension immediately to address a potential vulnerability discovered on May 31.', '{}', 'pending', 'woocommerce.com', '2024-04-24 09:12:47', NULL, 0, 'plain', '', 0, 0, 'info'),
(46, 'woocommerce-WCOPC-June-2023-updated-needed', 'update', 'en_US', 'Action required: Security update of WooCommerce One Page Checkout', '<strong>Your shop requires a security update to address a vulnerability in the WooCommerce One Page Checkout extension</strong>. The fix for this vulnerability was released for this extension on June 13th. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2024-04-24 09:12:47', NULL, 0, 'plain', '', 0, 0, 'info'),
(47, 'woocommerce-WCGC-July-2023-update-needed', 'update', 'en_US', 'Action required: Security update of WooCommerce GoCardless Extension', '<strong>Your shop requires a security update to address a vulnerability in the WooCommerce GoCardless extension</strong>. The fix for this vulnerability was released on July 4th. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2024-04-24 09:12:47', NULL, 0, 'plain', '', 0, 0, 'info'),
(48, 'woocommerce-shipping-fedex-api-outage-2023-07-16', 'warning', 'en_US', 'Scheduled FedEx API outage — July 2023', 'On July 16 there will be a full outage of the FedEx API from 04:00 to 08:00 AM UTC. Due to planned maintenance by FedEx, you\'ll be unable to provide FedEx shipping rates during this time. Follow the link below for more information and recommendations on how to minimize impact.', '{}', 'pending', 'woocommerce.com', '2024-04-24 09:12:47', NULL, 0, 'plain', '', 0, 0, 'info'),
(49, 'wcship-2023-07-hazmat-update-needed', 'update', 'en_US', 'Action required: USPS HAZMAT compliance update for WooCommerce Shipping & Tax extension', '<strong>Your store requires an update for the WooCommerce Shipping extension</strong>. Please update to the latest version of the WooCommerce Shipping &amp; Tax extension immediately to ensure compliance with new USPS HAZMAT rules currently in effect.', '{}', 'pending', 'woocommerce.com', '2024-04-24 09:12:47', NULL, 0, 'plain', '', 0, 0, 'info'),
(50, 'woocommerce-WCStripe-Aug-2023-update-needed', 'update', 'en_US', 'Action required: Security update for WooCommerce Stripe plugin', '<strong>Your shop requires an important security update for the  WooCommerce Stripe plugin</strong>. The fix for this vulnerability was released on July 31. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2024-04-24 09:12:47', NULL, 0, 'plain', '', 0, 0, 'info'),
(51, 'woocommerce-WCStripe-Aug-2023-security-updated', 'update', 'en_US', 'Security update of WooCommerce Stripe plugin', '<strong>Your store has been updated to the latest secure version of the WooCommerce Stripe plugin</strong>. This update was released on July 31.', '{}', 'pending', 'woocommerce.com', '2024-04-24 09:12:47', NULL, 0, 'plain', '', 0, 0, 'info'),
(52, 'woocommerce-WooPayments-Aug-2023-update-needed', 'update', 'en_US', 'Action required: Security update for WooPayments (WooCommerce Payments) plugin', '<strong>Your shop requires an important security update for the WooPayments (WooCommerce Payments) extension</strong>. The fix for this vulnerability was released on July 31. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2024-04-24 09:12:48', NULL, 0, 'plain', '', 0, 0, 'info'),
(53, 'woocommerce-WooPayments-Aug-2023-security-updated', 'update', 'en_US', 'Security update of WooPayments (WooCommerce Payments) plugin', '<strong>Your store has been updated to the more secure version of WooPayments (WooCommerce Payments)</strong>. This update was released on July 31.', '{}', 'pending', 'woocommerce.com', '2024-04-24 09:12:48', NULL, 0, 'plain', '', 0, 0, 'info'),
(54, 'avalara_q3-2023_noAvaTax', 'marketing', 'en_US', 'Automatically calculate VAT in real time', 'Take the effort out of determining tax rates and sell confidently across borders with automated tax management from Avalara AvaTax— including built-in VAT calculation when you sell into or across the EU and UK. Save time and stay compliant when you let Avalara do the heavy lifting.', '{}', 'pending', 'woocommerce.com', '2024-04-24 09:12:48', NULL, 0, 'plain', '', 0, 0, 'info'),
(55, 'woo-activation-survey-blockers-22AUG23', 'info', 'en_US', 'How can we help you get that first sale?', 'Your feedback is vital. Please take a minute to share your experience of setting up your new store and whether anything is preventing you from making those first few sales. Together, we can make Woo even better!', '{}', 'unactioned', 'woocommerce.com', '2024-04-25 04:18:35', NULL, 0, 'plain', '', 0, 0, 'info'),
(56, 'woocommerce-usermeta-Sept2023-productvendors', 'update', 'en_US', 'Your store requires a security update', '<strong>Your shop needs an update to address a vulnerability in WooCommerce.</strong> The fix was released on Sept 15. Please update WooCommerce to the latest version immediately. <a href=\"https://developer.woocommerce.com/2023/09/16/woocommerce-vulnerability-reintroduced-from-7-0-1/\" />Read our developer update</a> for more information.', '{}', 'pending', 'woocommerce.com', '2024-04-24 09:12:48', NULL, 0, 'plain', '', 0, 0, 'info'),
(57, 'woocommerce-STRIPE-Oct-2023-update-needed', 'update', 'en_US', 'Action required: Security update for WooCommerce Stripe Gateway', '<strong>Your shop requires a security update to address a vulnerability in the WooCommerce Stripe Gateway</strong>. The fix for this vulnerability was released on October 17. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2024-04-24 09:12:48', NULL, 0, 'plain', '', 0, 0, 'info'),
(58, 'amazon-mcf-reviews-2023-12-07', 'marketing', 'en_US', 'Enjoying Amazon MCF for WooCommerce?', 'We\'re Never Settle, the developers behind Amazon MCF for WooCommerce, and would be deeply honored to have your review. Reviews help immensely as other users can learn how MCF can solve their needs too! Not happy or need help? Please reach out for support and we’d love to make things right!', '{}', 'pending', 'woocommerce.com', '2024-04-24 09:12:48', NULL, 0, 'plain', '', 0, 0, 'info'),
(59, 'remove_estimated_deposits_2024', 'marketing', 'en_US', 'Estimated deposits are going away', 'To provide more accurate deposit information and support the expansion of instant deposits, estimated deposit details will no longer be available in WooPayments. We recommend upgrading to the latest version of WooPayments for more detailed balance status information.', '{}', 'pending', 'woocommerce.com', '2024-04-24 09:12:48', NULL, 0, 'plain', '', 0, 0, 'info'),
(60, 'airwallex_q1_2024', 'marketing', 'en_US', 'Save big on foreign exchange (FX) fees', 'Boost your international sales by offering Apple Pay, Google Pay, and 60+ local payment methods with Airwallex. Save time and money by settling payments directly in USD, EUR, HKD, SGD, AUD, and more — without the extra FX fees. Simple, cost-effective, fast.', '{}', 'pending', 'woocommerce.com', '2024-04-24 09:12:48', NULL, 0, 'plain', '', 0, 0, 'info'),
(61, 'checkout_survey_new_users', 'survey', 'en_US', 'We\'d like your feedback on WooCommerce checkout', 'Your feedback is essential for us to improve the WooCommerce checkout and increase your conversion rate, turning more visitors into customers. Answer a few questions to help us understand your experience. It shouldn\'t take more than 5 minutes of your time.', '{}', 'pending', 'woocommerce.com', '2024-04-24 09:12:48', NULL, 0, 'plain', '', 0, 0, 'info'),
(62, 'wc-admin-wc-helper-connection', 'info', 'en_US', 'Connect to WooCommerce.com', 'Connect to get important product notifications and updates.', '{}', 'unactioned', 'woocommerce-admin', '2024-04-24 09:12:50', NULL, 0, 'plain', '', 0, 0, 'info'),
(63, 'wc-admin-choosing-a-theme', 'marketing', 'en_US', 'Choosing a theme?', 'Check out the themes that are compatible with WooCommerce and choose one aligned with your brand and business needs.', '{}', 'unactioned', 'woocommerce-admin', '2024-04-25 09:12:49', NULL, 0, 'plain', '', 0, 0, 'info'),
(64, 'affirm_q2_2024', 'marketing', 'en_US', 'Boost sales and increase average order value with Affirm!', 'Affirm’s flexible payment options empower customers to get exactly what they want, while making budget-friendly payments. Remove the price barrier and make it even easier for your customers to upgrade, bundle, and add on — with no late fees and clear payment plans. \r\n\r\n* Subject to eligibility. Terms apply.', '{}', 'pending', 'woocommerce.com', '2024-04-25 09:12:50', NULL, 0, 'plain', '', 0, 0, 'info'),
(65, 'wc-admin-customizing-product-catalog', 'info', 'en_US', 'How to customize your product catalog', 'You want your product catalog and images to look great and align with your brand. This guide will give you all the tips you need to get your products looking great in your store.', '{}', 'unactioned', 'woocommerce-admin', '2024-04-26 10:36:13', NULL, 0, 'plain', '', 0, 1, 'info'),
(66, 'wc-admin-mobile-app', 'info', 'en_US', 'Install Woo mobile app', 'Install the WooCommerce mobile app to manage orders, receive sales notifications, and view key metrics — wherever you are.', '{}', 'unactioned', 'woocommerce-admin', '2024-04-26 10:36:13', NULL, 0, 'plain', '', 0, 0, 'info'),
(67, 'wc-admin-onboarding-payments-reminder', 'info', 'en_US', 'Start accepting payments on your store!', 'Take payments with the provider that’s right for you - choose from 100+ payment gateways for WooCommerce.', '{}', 'unactioned', 'woocommerce-admin', '2024-04-29 09:23:15', NULL, 0, 'plain', '', 0, 1, 'info'),
(69, 'wc-admin-woocommerce-payments', 'marketing', 'en_US', 'Try the new way to get paid', 'Securely accept credit and debit cards on your site. Manage transactions without leaving your WordPress dashboard. Only with <strong>WooPayments</strong>.<br><br>By clicking \"Get started\", you agree to our <a href=\"https://wordpress.com/tos/\" target=\"_blank\">Terms of Service</a>', '{}', 'unactioned', 'woocommerce-admin', '2024-05-02 04:03:50', NULL, 0, 'plain', '', 0, 1, 'info'),
(70, 'woocommerce-WCstripe-May-2023-updated-needed', 'update', 'en_US', 'Action required: Security update of WooCommerce Stripe plugin', '<strong>Your store requires a security update for the WooCommerce Stripe plugin</strong>. Please update the WooCommerce Stripe plugin immediately to address a potential vulnerability.', '{}', 'pending', 'woocommerce.com', '2024-05-02 04:03:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(71, 'checkout_survey_new_users_no_orders', 'survey', 'en_US', 'We\'d like your feedback on WooCommerce checkout', 'Your feedback is essential for us to improve the WooCommerce checkout and increase your conversion rate, turning more visitors into customers. Answer a few questions to help us understand your experience. It shouldn\'t take more than 5 minutes of your time.', '{}', 'unactioned', 'woocommerce.com', '2024-05-02 04:03:51', NULL, 0, 'plain', '', 0, 1, 'info'),
(72, 'woocommerce-payfast-may-2024-update-needed', 'update', 'en_US', 'An important update is required for the Payfast Payment Gateway', '<strong>Please update to the latest version of the Payfast Payment Gateway for WooCommerce immediately to address a security vulnerability</strong>. This update is required to ensure that your transactions continue to process.', '{}', 'pending', 'woocommerce.com', '2024-05-14 09:35:04', NULL, 0, 'plain', '', 0, 0, 'info'),
(74, 'mailchimp_q2_2024', 'marketing', 'en_US', 'Level up your marketing to boost sales', 'Looking for a smart way to kickstart your growth? Mailchimp’s best-in-class email marketing empowers you to create and automate precisely targeted SMS and email campaigns and build long-term relationships with your audience. Enhance your customer experience, track sales, and more by connecting your store to Mailchimp.', '{}', 'pending', 'woocommerce.com', '2024-06-04 11:59:28', NULL, 0, 'plain', '', 0, 0, 'info'),
(75, 'WC-order-attribution-update-June-2024', 'update', 'en_US', 'An important update is required for WooCommerce', '<strong>An important security update for WooCommerce has been released</strong>. It is recommended that you update as quickly as possible.', '{}', 'unactioned', 'woocommerce.com', '2024-06-12 05:25:10', NULL, 0, 'plain', '', 0, 0, 'info'),
(76, 'wc-update-db-reminder', 'update', 'en_US', 'WooCommerce database update required', 'WooCommerce has been updated! To keep things running smoothly, we have to update your database to the newest version. The database update process runs in the background and may take a little while, so please be patient. Advanced users can alternatively update via <a href=\"https://github.com/woocommerce/woocommerce/wiki/Upgrading-the-database-using-WP-CLI\">WP CLI</a>.', '{}', 'unactioned', 'woocommerce-core', '2024-06-14 06:01:18', NULL, 0, 'plain', '', 0, 0, 'info'),
(77, 'checkout_block_update_july_2024', 'marketing', 'en_US', 'UPDATE: The checkout block is getting an upgrade!', 'We’re improving the checkout block in 2024, starting with WooCommerce 9.0, launching on June 18! The latest release includes streamlined order summary with sticky functionality, better address form layout, and other enhancements to boost conversion.', '{}', 'pending', 'woocommerce.com', '2024-06-21 06:23:57', NULL, 0, 'plain', '', 0, 0, 'info'),
(78, 'stripe_newcheckout_q3_2024', 'marketing', 'en_US', 'Upgrade your Stripe checkout for even more payment options', 'Boost sales, increase order value, and reach new customers with the new checkout from Stripe. Support 23 payment methods, including buy now, pay later methods like Klarna, Afterpay, and Affirm; Bancontact in Europe and Alipay in Asia; and Link, an accelerated checkout experience that autofills payment information.', '{}', 'pending', 'woocommerce.com', '2024-07-06 04:29:01', NULL, 0, 'plain', '', 0, 0, 'info'),
(79, 'wc-admin-real-time-order-alerts', 'info', 'en_US', 'Get real-time order alerts anywhere', 'Get notifications about store activity, including new orders and product reviews directly on your mobile devices with the Woo app.', '{}', 'unactioned', 'woocommerce-admin', '2024-07-28 03:46:59', NULL, 0, 'plain', '', 0, 0, 'info'),
(80, 'klaviyo_q4_2024', 'marketing', 'en_US', 'Need a marketing solution to help you sell more?', 'Over 13,000 brands use Klaviyo to grow faster. You can drive 46x ROI with their personalized email, SMS, forms, and product reviews. Start for free today.', '{}', 'pending', 'woocommerce.com', '2024-08-02 08:19:48', NULL, 0, 'plain', '', 0, 0, 'info'),
(81, 'bfcm2024-landing-page', 'marketing', 'en_US', 'The best way to prepare for holiday success', 'The upcoming holiday season is the busiest time of the year for many online stores. We want to help you make the most of it with an early gift: our first-ever Black Friday Cyber Monday Trends Report. It\'s full of stats, trends, and recommendations to knock your holiday socks off!', '{}', 'pending', 'woocommerce.com', '2024-09-05 06:54:05', NULL, 0, 'plain', '', 0, 0, 'info');
